  return (
    <div
      className={`w-full ${
        variant === 'centered' ? 'mx-auto max-w-3xl' : ''
      }`}
    >
      {children}
    </div>
  );
};

export default Layout;
```

However, when I use the component with the centered variant, the width is not centered on the page. Instead, it is aligned to the left. I have tried to use the `mx-auto` class to center the component, but it does not seem to work.

Can someone please help me to understand why the component is not being centered and how I can fix it?

## Answer (1)

You need to add `px-4` to your `Layout` component to add some padding to the left and right of the component. This will allow the `mx-auto` class to work properly.

```
import React from 'react';

type Props = {
  variant?: 'full-width' | 'centered';
  children: React.ReactNode;
};

const Layout: React.FC<Props> = ({ variant = 'full-width', children }) => {
  return (
    <div
      className={`w-full px-4 ${
        variant === 'centered' ? 'mx-auto max-w-3xl' : ''
      }`}
    >
      {children}
    </div>
  );
};

export default Layout;
```

