Static variables are used to retain their values between function calls. They are initialized only once, at the start of the program, and their values are preserved between function calls. This makes them useful for storing data that needs to be shared between multiple functions or for implementing stateful behavior in a program.

Here is an example of using a static variable to count the number of times a function is called:
